m1 = v.rotors(1).mass; m2 = v.rotors(2).mass; mv = v.body.mass;
% c1 = v.centermass(1); c2 = v.centermass(2); % Not currently used given
% exsisting assumptions
c3 = v.centermass(3);
% g1 = v.rotLocs(1,1); g2 = v.rotLocs(2,1); 
g3 = v.rotorLocs(3,1); 
% h1 = v.rotLocs(1,2); h2 = v.rotLocs(2,2); 
h3 = v.rotorLocs(3,2);
