Ip122 = v.rotors(1).inertia(2,2);
Ip133 = v.rotors(1).inertia(3,3);
Ip211 = v.rotors(2).inertia(1,1);
Ip222 = v.rotors(2).inertia(2,2);
Ip233 = v.rotors(2).inertia(3,3);
tp13 = v.rotors(1).torqueCM(3);
