 + 2*g3^4*m1^3*x(8)*x(9) + 2*h3^4*m2^3*x(8)*x(9) + 2*Icv22*f2*g3*m1 + Ip111*f2*g3*m1 + Ip122*f2*g3*m1 + Ip211*f2*g3*m1 + Ip222*f2*g3*m1 + 2*Icv22*f2*h3*m2 + Ip111*f2*h3*m2 + Ip122*f2*h3*m2 + Ip211*f2*h3*m2 + Ip222*f2*h3*m2 - Ip111*c3*f2*mv*cos(2*x(14)) + Ip122*c3*f2*mv*cos(2*x(14)) - Ip111*f2*g3*m1*cos(2*x(14)) + Ip122*f2*g3*m1*cos(2*x(14)) - Ip111*f2*h3*m2*cos(2*x(14)) + Ip122*f2*h3*m2*cos(2*x(14)) - Ip211*c3*f2*mv*cos(2*x(16)) + Ip222*c3*f2*mv*cos(2*x(16)) + Ip111*c3*f1*mv*sin(2*x(14)) - Ip122*c3*f1*mv*sin(2*x(14)) - Ip211*f2*g3*m1*cos(2*x(16)) + Ip222*f2*g3*m1*cos(2*x(16)) - Ip211*f2*h3*m2*cos(2*x(16)) + Ip222*f2*h3*m2*cos(2*x(16)) + Ip111*f1*g3*m1*sin(2*x(14)) - Ip122*f1*g3*m1*sin(2*x(14)) + Ip111*f1*h3*m2*sin(2*x(14)) - Ip122*f1*h3*m2*sin(2*x(14)) - 2*Ip133*c3^2*mv^2*x(13)*x(8) - 2*Ip233*c3^2*mv^2*x(15)*x(8) - 2*Ip133*g3^2*m1^2*x(13)*x(8) - 2*Ip133*h3^2*m2^2*x(13)*x(8) - 2*Ip233*g3^2*m1^2*x(15)*x(8) - 2*Ip233*h3^2*m2^2*x(15)*x(8) + Ip211*c3*f1*mv*sin(2*x(16)) - Ip222*c3*f1*mv*sin(2*x(16)) + 4*Icv22*c3^2*mv^2*x(8)*x(9) - 2*Icv33*c3^2*mv^2*x(8)*x(9) + 2*Ip111*c3^2*mv^2*x(8)*x(9) + 2*Ip122*c3^2*mv^2*x(8)*x(9) - 2*Ip133*c3^2*mv^2*x(8)*x(9) + 2*Ip211*c3^2*mv^2*x(8)*x(9) + 2*Ip222*c3^2*mv^2*x(8)*x(9) - 2*Ip233*c3^2*mv^2*x(8)*x(9) + Ip211*f1*g3*m1*sin(2*x(16)) - Ip222*f1*g3*m1*sin(2*x(16)) + 4*Icv22*g3^2*m1^2*x(8)*x(9) - 2*Icv33*g3^2*m1^2*x(8)*x(9) + 2*Ip111*g3^2*m1^2*x(8)*x(9) + 2*Ip122*g3^2*m1^2*x(8)*x(9) - 2*Ip133*g3^2*m1^2*x(8)*x(9) + 2*Ip211*g3^2*m1^2*x(8)*x(9) + 2*Ip222*g3^2*m1^2*x(8)*x(9) - 2*Ip233*g3^2*m1^2*x(8)*x(9) + Ip211*f1*h3*m2*sin(2*x(16)) - Ip222*f1*h3*m2*sin(2*x(16)) + 4*Icv22*h3^2*m2^2*x(8)*x(9) - 2*Icv33*h3^2*m2^2*x(8)*x(9) + 2*Ip111*h3^2*m2^2*x(8)*x(9) + 2*Ip122*h3^2*m2^2*x(8)*x(9) - 2*Ip133*h3^2*m2^2*x(8)*x(9) + 2*Ip211*h3^2*m2^2*x(8)*x(9) + 2*Ip222*h3^2*m2^2*x(8)*x(9) - 2*Ip233*h3^2*m2^2*x(8)*x(9) - 2*Icv22*Ip133*m1*x(13)*x(8) - 2*Icv22*Ip133*m2*x(13)*x(8) - 2*Ip111*Ip122*m1*x(13)*x(8) - 2*Ip111*Ip122*m2*x(13)*x(8) - Ip111*Ip133*m1*x(13)*x(8) - I